import axios from "axios";
const URL = 'http://localhost:8080/'

async function saveUserData(token,data){
    await axios.post(URL+`postReactAssigFormData`, { token,data }).then((response)=>{
        console.log(response)
        return response.data;
    })
}

export {saveUserData};
